import React from "react";
import "./SearchResults.css";

const SearchResults = props => (
  <ul className="list-group search-results">

    <li className="list-group-item">
      <h3>Drug Info:</h3>
      <p>{props.results}</p>
    </li>
    <li className="list-group-item">
      <h3>Box Warning:</h3>
      <p>{props.results2}</p>

    </li>
  </ul>
);

export default SearchResults;
